import React from "react";
import { Component } from "../../components/Component";
import { Caret } from "../../icons/Caret";
import { Icon1 } from "../../icons/Icon1";
import { Icon2 } from "../../icons/Icon2";
import { Icon7 } from "../../icons/Icon7";
import image8 from "../../img/image-108.png";
import rectangle from "../../img/rectangle-9.svg";
import rectangle7 from "../../img/rectangle-7-1.png";
import fullLogo2 from '../../img/fulllogo-transparent-nobuffer-2-2.png';
import fullLogo1 from '../../img/fulllogo-transparent-nobuffer-1-1.png';
import { IconPaginationPrev1 } from "../../icons/IconPaginationPrev1";
import line from '../../img/line-89-1.svg';
import next from '../../img/icon-pagination-next.svg';

import SidePanel from '../CompareProperty/SidePanel';

const PropertyCard = ({ address, rent, distance, details }) => (
  <div className="relative w-[228px] h-[718px]">
    {/* Define the structure and styling of the property card */}
    {/* Include logic for displaying property details */}
  </div>
);

const DrildownAppcopilot = () => {
  const questions = [
    'What should I do if I notice suspicious activity on my account?',
    'How can I update my property listing?',
    'How do I change my email alert preferences?',
    'How do I reset my password?',
    'When should I raise or lower my rent price?',
    'What should I do if I notice suspicious activity on my account?'
  ];

  const rentals = [
    // Define properties to compare
  ];

  return (
    <div className="bg-white flex flex-row justify-center w-full">
      <div className="bg-white w-[1440px] h-[2474px] relative">
        <RentSuggestionCard
          address="3806 W 20th Ave"
          details="Kennewick, WA 99338 • 3 beds • 2.5 baths • 2400 Sq Ft • Lease Expiry Date - 25/06/2024"
          suggestedRent="$3,779 /SqFT"
          rentRange="$3,553 - $4,005"
        />
        <LocalRentalMarketplace rentals={rentals} />
        <FAQSection questions={questions} />
        <SidePanel />
      </div>
    </div>
  );
};

function FAQ({q='What should I do if I notice suspicious activity on my account?'}) {
  return (
                    <div className="relative w-[466px] h-[92px] bg-[#f4f4f6] rounded-[18px]">
                      <div className="relative w-[413px] h-[46px] top-[23px] left-[27px]">
                        <p className="absolute w-[306px] top-0 left-0 [font-family:'Poppins',Helvetica] font-normal text-black text-base tracking-[0] leading-[23px]">
                          {q}
                        </p>
                        <div className="absolute w-[42px] h-[42px] top-0.5 left-[370px] bg-[#ff914d] rounded-lg">
                          <img
                            className="absolute w-[19px] h-[19px] top-[11px] left-[11px]"
                            alt="Group"
                            src="/img/group-36811-5.png"
                          />
                        </div>
                      </div>
                    </div>
  );
}

// ImageSection Component
const ImageSection = ({ rect }) => (
  <div className="relative w-full h-[637px]">
    <img
      className="absolute w-[140px] h-[637px] top-[81px] left-[74px]"
      alt="Background Rectangle"
      src={rectangle}
    />
    <img
      className="absolute w-[240px] h-[174px] top-0 "
      alt="Top Rectangle"
      src={rect}
    />
  </div>
);

// RatingIndicator Component
const RatingIndicator = () => (
  <div className="absolute w-9 h-[7px] top-[159px] left-[82px] bg-[#2a2a33] rounded-full">
    <div className="flex items-center space-x-1.5 absolute top-0 left-0.5">
      {[...Array(5)].map((_, i) => (
        <div
          key={i}
          className={`w-${i === 0 ? '10.75' : '3.39'} h-${i === 0 ? '4.52' : '3.39'} bg-white rounded-full ${i > 0 ? 'opacity-60' : ''}`}
        />
      ))}
    </div>
  </div>
);

// PropertyDetails Component
const PropertyDetails = () => (
  <div className="absolute w-full top-[190px] left-0">
    <div className="font-bold text-black text-base"> $3,750/mo </div>
    <div className="text-[#2a2a33] text-sm mt-1"> $2.08 per sq ft </div>
    <img
      className="w-[126px] h-[1px] my-4"
      alt="Separator Line"
      src="/img/line-91.svg"
    />
    <div className="font-bold text-orange text-sm"> 1621 166th Ave NE </div>
    <div className="text-[#2a2a33] text-sm mt-1"> 0.8 miles away </div>
    <div className="flex items-center mt-4">
      <div className="w-3 h-3 bg-green-500 rounded-md"></div>
      <span className="ml-2 text-[#2a2a33] text-sm"> Active 1 day </span>
    </div>
    <img
      className="w-[126px] h-[1px] my-4"
      alt="Separator Line"
      src="/img/line-91.svg"
    />
    <div className="text-[#2a2a33] text-sm"> 3 beds </div>
    <div className="text-[#2a2a33] text-sm mt-1"> 2 baths </div>
    <div className="text-[#2a2a33] text-sm mt-1"> 1,800 sq ft </div>
    <img
      className="w-[126px] h-[1px] my-4"
      alt="Separator Line"
      src="/img/line-91.svg"
    />
    <div className="text-[#2a2a33] text-sm"> In-unit laundry </div>
    <img
      className="w-[126px] h-[1px] my-4"
      alt="Separator Line"
      src="/img/line-91.svg"
    />
    <div className="text-[#2a2a33] text-sm"> Garage parking </div>
    <img
      className="w-[126px] h-[1px] my-4"
      alt="Separator Line"
      src="/img/line-91.svg"
    />
    <div className="text-[#2a2a33] text-sm"> No A/C </div>
    <img
      className="w-[126px] h-[1px] my-4"
      alt="Separator Line"
      src="/img/line-91.svg"
    />
    <div className="text-[#2a2a33] text-sm"> No heating </div>
    <img
      className="w-[126px] h-[1px] my-4"
      alt="Separator Line"
      src="/img/line-91.svg"
    />
    <div className="text-[#2a2a33] text-sm"> Cats & small dogs </div>
  </div>
);

// IconOverlay Component
const IconOverlay = () => (
  <div className="absolute w-[23px] h-[23px] top-1.5 left-[183px] bg-[#00000069] rounded-full backdrop-blur-sm backdrop-brightness-100">
    <img
      className="absolute w-[11px] h-3 top-1.5 left-1.5"
      alt="Overlay Icon"
      src="/img/icon-5.svg"
    />
  </div>
);

// Main Property Component
const Property = ({ rect }) => (
  <div className="relative w-[228px] h-[718px]">
    <div className="relative w-56 h-[718px] left-3.5">
      <ImageSection rect={rectangle7} />
      <RatingIndicator />
      <PropertyDetails />
      <IconOverlay />
    </div>
  </div>
);
